Watch #GeetasGuide now: http://www.weareo.tv/originals/geetas-guide-to-moving-on

#femalefilmmakerfriday

The North Pole series writer and co-producer Josh Healy on using humor to tell stories about gentrification:

&quot;Doom and gloom ain’t going to get the job done and it’s not going to reach the people we want to talk to. Laughter is the way to bring people in. We want to acknowledge the reality of what’s going on and the pain and the anger and the sadness. Laughter is the way to deal with it and also to remind us of the joy and the humanity that we’re fighting for in the first place.&quot;

You can now watch all of The North Pole on #OTV! Enjoy: http://www.weareo.tv/represents//the-north-pole

Hair Story premieres this cycle! Stay tuned. 

“Hair Story” is a pilot for a web series that follows a group of Chicagoans in their everyday lives as they try to keep their co-op open and in their dreams, blending sitcom and music video.

